		"text": "재발 금지 3법:\n-성적 촬영물을 이용해 협박하는 행위를 형법상 특수협박죄로 처벌하고 상습범 가중처벌\n-불법 촬영물/복제물을 스마트폰 등 휴대용 단말기/컴퓨터에 다운로드받거나 본인의 의사에 반해 유포할 경우 처벌\n-불법 촬영물에 조치를 취하지 않은 정보통신서비스 제공자 처벌."
