		"full_text": "❝ 실제로 김단장의 논문 1편당 인용수는 256.2회에 달하는데, 이는 최근 10년간 노벨생리의학상 수상자 24인의 인용수 중간값인 127회와 비교해도 월등한 수치다. 대표 논문의 피인용수도 3476회로 중간값인 2133회를 웃돈다. 그가 생산한 논문 104편 중 70% 이상은 피인용 상위 10% 논문일 정도다.",
