		"text": "성범죄 처벌에 분노하는 곳에서 플레인 하는 것은 뭐랄까... 정말 그 내용을 다른 사람들이 몰라서 이야기 안하는 것이 아닐텐데... 냉철함도 중요하고 감정에 호소하는 것이 위험한지도 알지만 왜 많은 사람들이 분노하고 있는지 생각해봤으면. 진짜 공부하고 배운 사람은 지식을 이렇게 쓰지 않는다."
